import AppHeaderMain from './components/AppHeaderMain';
import AppHeaderBottom from './components/AppHeaderBottom';
import AppFooterTop from './components/AppFooterTop';
import AppFooterMain from './components/AppFooterMain';
import AppFooterBottom from './components/AppFooterBottom';


function App(){
  return (
    <>
      <AppHeaderMain/>
      <AppHeaderBottom/>
      <AppFooterTop/>
      <AppFooterMain/>
      <AppFooterBottom/>
    </>
  )
}

export default App;
